DROP DATABASE IF EXISTS `emerald_crown_bank`;
CREATE DATABASE `emerald_crown_bank`;
USE `emerald_crown_bank`;


CREATE Table emerald_crown_bank_customers (
		customer_id INT NOT NULL,
        first_name VARCHAR(50),
        last_name VARCHAR(50),
        gender VARCHAR(50),
        birth_date DATE,
        job VARCHAR(50),
        yearly_income INT,
        balance_customer FLOAT,
        state varchar(50),
        total_debt INT,
        credit_score INT,
        credit_cards INT,
		dti_ratio FLOAT GENERATED ALWAYS AS ((total_debt / (CAST(yearly_income AS FLOAT) / 12)) * 100) STORED,
        PRIMARY KEY (customer_id)
        );
        

    ;


-- Fixing errors in customer_id, need to disable and then restore pirmary key.
SET SQL_SAFE_UPDATES = 0;

ALTER TABLE emerald_crown_bank_customers ADD COLUMN temp_id INT;

SET @new_id = (SELECT MIN(customer_id) - 1 FROM emerald_crown_bank_customers);

UPDATE emerald_crown_bank_customers 
SET temp_id = (@new_id := @new_id + 1)
ORDER BY customer_id;

ALTER TABLE emerald_crown_bank_customers DROP COLUMN customer_id;
ALTER TABLE emerald_crown_bank_customers CHANGE COLUMN temp_id customer_id INT NOT NULL;

ALTER TABLE emerald_crown_bank_customers ADD PRIMARY KEY (customer_id);

SET SQL_SAFE_UPDATES = 1;
  
  
 CREATE TABLE emerald_crown_bank_departments (
    department_id INT NOT NULL AUTO_INCREMENT,
    department_name VARCHAR(100),
    department_head VARCHAR(100),
    budget_allocation INT,
    PRIMARY KEY (department_id)
);

 
     ;


SELECT state, COUNT(customer_id) AS customer_count
FROM emerald_crown_bank_customers
GROUP BY state
ORDER BY customer_count DESC
LIMIT 1;

SELECT*
FROM emerald_crown_bank_customers
